import React from 'react'
import { data } from './data'
import { Link } from 'react-router-dom'
const Home = () => {
  return (
    <div>
       {
        data.map((item)=>{
            return <section>
              <img src={item.image}/>

            </section>
        })
       }
    </div>
  )
}

export default Home
